import React, { Component } from 'react';
import Table from './Table.js';

class Tabs extends Component {
  render() {
    const element = (<span><ul className="nav nav-tabs" role="tablist">
      <li className="nav-item">
        <a className="nav-link active" data-toggle="tab" href="#video">Video</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" data-toggle="tab" href="#audio">Audio</a>
      </li>
    </ul>
    <div className="tab-content">
      <div id="video" className="tab-pane active">

      </div>
      <div id="audio" className="tab-pane fade">

      </div>
    </div></span>);

    return element;
  }
}

export default Tabs;
